package com.example.music_app;

import androidx.annotation.NonNull;
import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.DefaultItemAnimator;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import com.google.android.gms.tasks.OnCompleteListener;
import com.google.android.gms.tasks.Task;
import com.google.firebase.firestore.DocumentReference;
import com.google.firebase.firestore.DocumentSnapshot;
import com.google.firebase.firestore.FirebaseFirestore;
import com.google.firebase.firestore.Query;
import android.os.Bundle;
import android.util.Log;
import android.widget.EditText;

import com.example.music_app.Adapter.musicIstrumentAdapter;
import com.example.music_app.model.MusicModel;

import java.util.ArrayList;

public class home_screen extends AppCompatActivity {

    EditText serchText;
    RecyclerView lists;
    ArrayList<MusicModel> musicList;

    private FirebaseFirestore db;

    public String[] itemNamelist = {"Key Bord","Drums","Bass Guitar","Classic Guitar","Tabla"};
    public String[] itemDesticlist = {"sample description","Drums is best","Bass Guitar for rent","Classic Guitar for sale","Tabla for rent"};
    public String[] itemImagelist = {
            "data:image/jpeg;base64,",
            "Drums",
            " data:image/jpeg;base64,",
            " data:image/jpeg;base64,",
            "Tabla"
    };

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_home_screen);

        for (int i = 0; i < itemNamelist.length; i++) {
            MusicModel model = new MusicModel();

            model.setItemId(i);
            model.setImageValue(itemImagelist[i]);
            model.setItemDescirption(itemDesticlist[i]);
            model.setItemName(itemNamelist[i]);

            musicList.add(model);
        }

        init();
        getMusicDataFromFireStore();

        musicIstrumentAdapter adpter = new musicIstrumentAdapter(musicList);

        lists = findViewById(R.id.musicListView);
        lists.setLayoutManager(new LinearLayoutManager(this));
        lists.setItemAnimator(new DefaultItemAnimator());
        lists.setAdapter(adpter);
    }

    public void init(){
        db = FirebaseFirestore.getInstance();
    }

    public ArrayList<MusicModel> getMusicDataFromFireStore(){

        DocumentReference docRef = db.collection("item").document("SF");

        docRef.get().addOnCompleteListener(new OnCompleteListener<DocumentSnapshot>() {
            @Override
            public void onComplete(@NonNull Task<DocumentSnapshot> task) {
                if (task.isSuccessful()) {
                    DocumentSnapshot document = task.getResult();
                    if (document.exists()) {
                        System.out.println("DocumentSnapshot data: " + document.getData());
                    } else {
                        System.out.println("No such document");
                    }
                } else {
                    System.out.println("get failed with "+ task.getException());
                }

            }
        });


        return null;
    }
}